import React from 'react'

class App extends React.Component
{
    constructor()
    {
        super()
        this.state={
            isLoggedIn: false
        }
    }
    render()
    {
        let wordDisplay
        if(this.state.isLoggedIn){
            wordDisplay = 'In'
        }
        else{
            wordDisplay = 'Out'
        }
        return(
        <div>
            <h1>U r logged {wordDisplay} </h1>
        </div>)
    }
}

export default App
